   "source": [
    "num_of_weekdays_plot <- ggplot(data = Avg_ride_len_weekdays, aes(x = day_of_weekdays, y = mean_ride_len))\n",
    "num_of_weekdays_plot + geom_bar(stat = \"identity\", aes(fill = member_casual), position = \"dodge\") + \n",
    "  labs(title = \"Average ride length on weekday comparison (Dec 2021 to Nov 2022)\", caption = \"The data taken from Dec 2021 to Nov 2022\") +\n",
    "  theme(axis.text.x = element_text(angle = 45)) + \n",
    "  geom_text(aes(label = round(mean_ride_len)), vjust = \"right\", hjust = \"left\")"
   ]
  },
