   "source": [
    "**key takeaways**\n",
    "* Casual users tended to ride more during Feb - May. Their participation exceeded that of the long term members.\n",
    "* To further that the Casual demographic spent on average a lot longer time per ride than their long-term counter-parts.\n",
    "* The days of the week also further shows that causal riders prefer to use the service during the weekends as their usage peaked then. The long term members conversly utilised the service more-so throughout the typical work week i.e (Monday- friday)"
   ]
